import React, { ReactElement } from "react";
import styled from "styled-components/native";
import { View, H1, TextInput, Button, Text } from "../styles";

interface Props {}

const LandingDiv = styled(View)`
  flex: 1;
  justify-content: center;
  align-items: center;
`;

const LandingH1 = styled(H1)`
  font-size: 50;
`;

export const P = styled(Text)`
  opacity: 0.7;
  /* margin-top: 25px; */
  font-size: 22;
  padding: 20px;
  text-align: center;
`;

export default function Landing({}: Props): ReactElement {
  return (
    <LandingDiv>
      <LandingH1>Dev Comm</LandingH1>
      <P>A chat community for developers to connect and collaborate</P>
    </LandingDiv>
  );
}
